insert into api_place (muni_id, idowner_id, lugar, description, calificacion) values (1, 1, 'Nevado de Santa Isabel', 'El nevado de Santa Isabel es una de las montañas de la cordillera Central de Colombia. Su cima se eleva a 4965 metros sobre el nivel del mar, y marca la frontera entre los departamentos de Risaralda, Tolima y Caldas, siendo el punto más alto del primero.​ ', '5.0');
insert into api_place (muni_id, idowner_id, lugar, description, calificacion) values (2, 2, 'Termales del Machin', 'Este volcán que es llamado Machín, Cerro Machín, Alto Machín y El Hoyo, perteneciente a la cadena volcánica de la Cordillera Central colombiana, se localiza en el departamento del Tolima, en las coordenadas geográficas 4° 29 N y 75° 22 O, a una dista de 17 km al oeste de Ibagué.', '5.0');
insert into api_place (muni_id, idowner_id, lugar, description, calificacion) values (3, 3, 'Termales La Cabaña', 'Los Termales de la Cabaña se encuentran en el municipio de Murillo, en el departamento del Tolima, exactamente en el Parque Nacional Natural Los Nevados, un escenario natural sin igual.', '5.0');
insert into api_place (muni_id, idowner_id, lugar, description, calificacion) values (4, 4, 'Cataratas de Medina', '7 kilómetros de Mariquita, Tolima; se encuentran las Cascadas del río Medina. Un lugar que se ha hecho famoso por sus aguas frescas y cristalinas y por el imponente paisaje que allí se conforma.', '4.0');
insert into api_place (muni_id, idowner_id, lugar, description, calificacion) values (5, 5, 'Toche', 'Toche es un corregimiento del municipio de Ibagué dentro del departamento del Tolima y es donde se encuentra el bosque de Palma de Cera más grande de Colombia y del mundo, además es el árbol nacional del país.', '4.9');
insert into api_place (muni_id, idowner_id, lugar, description, calificacion) values (6, 6, 'Palomar', 'El Palomar es un destino turístico en el Tolima, se encuentra a 2850 metros sobre el nivel del mar, con una temperatura promedio de 14 grados. Reconocido por ser una de las entradas al Parque Nacional Natural de los Nevados', '5.0');
insert into api_place (muni_id, idowner_id, lugar, description, calificacion) values (7, 7, 'Cascadas El Tambor', 'Es un bañadero formado por el represamiento del Río Tuluny, con fines agroindustriales que genera una gran caída de agua, formando un charco profundo, aprovechado por turistas y chaparralunos', '4.8');
insert into api_place (muni_id, idowner_id, lugar, description, calificacion) values (8, 8, 'Ciudad Perdida', 'Un poco más de 200 kilómetros separan a Bogotá de este histórico asentamiento ubicado al norte del departamento del Tolima.', '4.9');
insert into api_place (muni_id, idowner_id, lugar, description, calificacion) values (5, 9, 'El Rancho', 'El rancho tolima es un gran sitio turistico destacado por sus naturales termales y se encuentra ubicado en el camino hacia el nevado del tolima', '4.9');
insert into api_place (muni_id, idowner_id, lugar, description, calificacion) values (3, 10, 'Cascada El Silencio', 'Con una altura de alrededor de 35 metros este atractivo conocido como la Cascada El Silencio, es uno de los lugares más imponentes de esta localidad al norte tolimense.', '4.7');
insert into api_place (muni_id, idowner_id, lugar, description, calificacion) values (5, 9, 'Juntas', 'Juntas está en el Cañón del Combeima, para llegar hay que salir de Ibagué por la ruta del barrio Chapetón, sin embargo la ruta de bus número 48 lo puede llevar.', '4.9');
insert into api_place (muni_id, idowner_id, lugar, description, calificacion) values (5, 9, 'Cascada La Plata', 'La Cascada La Plata en Ibagué es considerada la más alta del Cañón del Combeima, con 490 metros de altura. Una maravilla natural que disfrutarás de conocer.', '4.9');
insert into api_place (muni_id, idowner_id, lugar, description, calificacion) values (5, 5, 'El Mirador de Juntas', 'Allí podrás llenar tus pulmones de aire puro y deleitarte con los sonidos que te brinda la naturaleza. El corregimiento de Juntas te brinda todas las posibilidades para tener un día inolvidable con tu familia y con tus amigos.', '4.5');
insert into api_place (muni_id, idowner_id, lugar, description, calificacion) values (9, 4, 'Cascadas de Payande', 'El corregimiento de Payandé tiene la gran fortuna de contar con un atractivo natural:  Seis cascadas que se caracterizan por su riqueza hídrica y su paisajes naturales, razón por la cual se ha convertido en uno de los lugares favoritos para los Ibaguereños.', '4.7');
insert into api_place (muni_id, idowner_id, lugar, description, calificacion) values (10, 2, 'Represa de Prado', 'Prado es un municipio del departamento de Tolima, ubicado a 2 horas de Ibagué, la capital del departamento, y a 5 horas de Bogotá. Su principal atractivo es la Represa de Hidroprado, ubicada a 15 minutos del municipio y alimentada por las aguas de los ríos Cunday y Negro, de la que nace el río Prado.', '4.6');
insert into api_place (muni_id, idowner_id, lugar, description, calificacion) values (11, 3, 'Laguna de las Garzas', 'Laguna de las Garzas, Roncesvalles, Tolima, Páramo de Anaime.', '4.9');
insert into api_place (muni_id, idowner_id, lugar, description, calificacion) values (5, 3, 'Termales de cañon', 'Ruta que comienza en la vereda de Juntas, ubicada a 24 kilometros, aprox. de la ciudad de Ibagué, y que cuenta con servicio regular de transporte público. la travesía completa comienza a unos 1500 m.s.n.m. y aciende hasta una altura de 4000 m.s.n.m. y se estima que se recorre una distancia de 30 km y se realiza en aproximadamente 14-16 horas de un ascenso permanente.', '4.9');
insert into api_place (muni_id, idowner_id, lugar, description, calificacion) values (12, 11, 'La Cueva del Esplendor', 'La Cueva del Esplendor esta ubicada en lo mas alto de una de las montañas que rodean el pueblo, en el sector conocido como el Alto de Las Flores; para llegar hasta alli, tenemos tres opciones, una es tomar un Jeep desde la terminal del pueblo hasta cierto punto de la montaña, y se debe continuar a pie.', '5.0');
insert into api_place (muni_id, idowner_id, lugar, description, calificacion) values (12, 12, 'Charco Corazon - Cascada del Amor', 'Cascada del Amor es un sendero de ida y vuelta de 4.2 kilómetros localizado cerca de Jardín, Antioquia, Colombia. Tiene una cascada y es bueno para todos los niveles de habilidad. El sendero ofrece una serie de opciones de actividades.', '5.0');
insert into api_place (muni_id, idowner_id, lugar, description, calificacion) values (12, 13, 'Cascada Escalera de Cristal', 'Las caídas de agua de Jardín Antioquia son de las más espectaculares que hay en el mundo. ¡Sobre todo la caída La Escalera! Esta tiene una altura mayor a los 60 metros y se puede dividir en dos etapas.', '5.0');
insert into api_place (muni_id, idowner_id, lugar, description, calificacion) values (13, 14, 'Chorros de Taparto', 'Chorros De Tapartó es un sendero de ida y vuelta de 13.5 kilómetros localizado cerca de Andes, Antioquia, Colombia. Tiene una cascada y es calificado como moderado. El sendero se usa principalmente para hacer senderismo y viajes por la naturaleza.', '5.0');
insert into api_place (muni_id, idowner_id, lugar, description, calificacion) values (12, 15, 'La Cueva de los Guacharos', 'Se encuentra en la parte alta de la quebrada La Salada en la vereda del mismo nombre a cinco kilómetros de la cabecera municipal. Se trata de una cascada que cae entre las montañas que se levantan alrededor de una cueva, donde habitan los Guácharos.', '5.0');
insert into api_place (muni_id, idowner_id, lugar, description, calificacion) values (14, 16, 'Cascada el manto de la virgen', 'Es una bella caída de agua ubicada a 10 kilómetros de Gámbita. Su exuberante belleza ha llamado la atención de turistas de todo el mundo, tanto que ahora es catalogada como uno de los lugares que hay que visitar en Colombia', '5.0');
insert into api_place (muni_id, idowner_id, lugar, description, calificacion) values (15, 17, 'Las ventanas de Tisquizoque', 'Es un sitio turístico por excelencia desde donde se puede observar una encantadora panorámica del municipio. Esta cueva natural recibe el nombre de Ventanas de Tizquizoque porque se pueden atravesar de lado a lado.', '5.0');
insert into api_place (muni_id, idowner_id, lugar, description, calificacion) values (16, 18, 'Las piscinas naturales', 'En esta finca quizá no hay muchas actividades por hacer, más que disfrutar del contacto con la naturaleza y refrescarse en las piscinas de agua natural que ofrece el sitio, respirar aire puro y desconectarse del estrés y día a día de la ciudad.', '5.0');
insert into api_place (muni_id, idowner_id, lugar, description, calificacion) values (17, 19, 'El hoyo de los pájaros', 'Este enigmático paraje mogotano alcanza una profundidad de 98 metros y diámetro de 30. El hoyo de los pájaros es casi que un capricho de la naturaleza que se convirtió en un caverna que alberga en el fondo legendarios y gigantes nidos de los ruidosos pájaros guácharos y aves suramericanas de unos 30 centímetros de largo.', '5.0');
insert into api_place (muni_id, idowner_id, lugar, description, calificacion) values (18, 19, 'Salto de la India', 'Es un alto de dos caídas y aguas frías que le permite fortalecer hábitos de vida saludable, tener contacto con los lugareños y conocer un poco más del departamento.', '5.0');
insert into api_place (muni_id, idowner_id, lugar, description, calificacion) values (19, 20, 'Termales de Santa Rosa de Cabal', 'Los Termales Santa Rosa de Cabal se encuentran ubicados en el municipio que lleva el mismo nombre, a pocos kilometros de Pereira. Se trata de un sitio privilegiado para la recreación y el descanso, con un entorno ecológico único. Ofreces a los visitantes montañas, cascadas y piscinas de agua termal y agua fría, así como rutas ecológicas.', '5.0');
insert into api_place (muni_id, idowner_id, lugar, description, calificacion) values (20, 21, 'Laguna del Otún', 'La laguna del Otún es un embalse natural perteneciente al parque nacional natural Los Nevados, localizado a unos 3950 msnm, en ecosistema de páramo. Formada por la acción volcánica y glaciar, es alimentada principalmente por el deshielo del Nevado de Santa Isabel.', '5.0');
insert into api_place (muni_id, idowner_id, lugar, description, calificacion) values (21, 22, 'Santuario Fauna y Flora Otún Quimbaya', 'Otun quimbaya y toda la región de Ukumari, que se extiende hasta el Parque Nacional Los Nevados, son vastas áreas de bosques andinos con alta biodiversidad y están ubicadas en el corazón de la zona cafetalera de la cordillera central.', '5.0');
insert into api_place (muni_id, idowner_id, lugar, description, calificacion) values (20, 23, 'Parque Tatamá', '51.900 hectáreas de valles, fuertes pendientes y páramos; yarumos, encenillos y algarrobos; tigrillos, dantas y cusumbos. El parque está ubicado al noroccidente de Pereira.', '5.0');
insert into api_place (muni_id, idowner_id, lugar, description, calificacion) values (20, 23, 'Parque Nacional los Nevados', 'Ubicado al este de Risaralda, ofrece un paisaje único de Nevados del Ruiz, Tolima y Santa Isabel, así como la Laguna Otún, cuna del río Otún, que cruza la ciudad de Pereira.', '5.0');
insert into api_place (muni_id, idowner_id, lugar, description, calificacion) values (22, 24, 'Valle de Cocora', 'A tan solo 10 kms de Salento, y 45 minutos de Armenia, la Capital del Departamento del Quindío, encontramos uno de los paisajes mas famosos del Eje Cafetero, y de toda Colombia. Lugar imperdible si desea conocer los principales sitios turisticos en el Quindio.', '5.0');
insert into api_place (muni_id, idowner_id, lugar, description, calificacion) values (22, 25, 'Salento', 'Salento es una municipalidad colombiana en el departamento del Quindío. Considerado el padre del Quindío por ser el pueblo más viejo de este departamento. También se le conoce como el municipio cuna del árbol Nacional Palma de Cera', '5.0');
insert into api_place (muni_id, idowner_id, lugar, description, calificacion) values (23, 26, 'El Jardín Botánico del Quindío', 'El Mariposario del Quindío, en el municipio de Calarcá, en un área de 600 metros cuadrados, es un espacio de conservación, ciencia y diversión. Además de ser el refugio de más de 1500 mariposas, alberga diversas especies de la fauna y la flora colombiana.', '5.0');
insert into api_place (muni_id, idowner_id, lugar, description, calificacion) values (22, 27, 'Parque de la vida', 'Uno de los referentes turísticos de la ciudad de Armenia, es el Parque de la Vida. Localizado al norte de la ciudad, sobre la Avenida Bolívar, principal arteria vehicular, comercial y turística de la capital del Departamento del Quindio.', '5.0');
insert into api_place (muni_id, idowner_id, lugar, description, calificacion) values (23, 28, 'Recuca', 'Recuca es un lugar donde el turista es bienvenido con un café preparado en aguapanela. Allí es transformado en actor. Con traje típico, canasto y machete al cinto comienza un largo recorrido que lo transporta por la historia del grano desde Etiopía, Arabia y Holanda llegando aquí a América.', '5.0');
insert into api_place (muni_id, idowner_id, lugar, description, calificacion) values (24, 29, 'Laguna Comagüeta', 'Está en el municipio de Chitagá a 3 horas de Cúcuta. La laguna está a una altura de 3.432 m.s.n.m a una hora y 30 min del pueblo.', '5.0');
insert into api_place (muni_id, idowner_id, lugar, description, calificacion) values (25, 30, 'Laguna de Cácota', 'Esta a 2.900 m.s.n.m. en el municipio del mismo nombre a 2 hr y 30 min de la capital de Norte de Santander.', '5.0');
insert into api_place (muni_id, idowner_id, lugar, description, calificacion) values (26, 31, 'Mutiscua', 'Está en Mutiscua, en el parque Natural Regional Santurbán. La capital de la trucha Arcoíris está a 2 hr y 30 min de Cúcuta.', '5.0');
insert into api_place (muni_id, idowner_id, lugar, description, calificacion) values (27, 32, 'La Laguna Quelpa', 'Esta belleza natural se encuentra en Cucutilla, Norte de Santander. Para llegar a ella hay que caminar por lo menos 8  u 11 desde al casco urbano del municipio.', '5.0');
insert into api_place (muni_id, idowner_id, lugar, description, calificacion) values (28, 33, 'Laguna Brava', 'Está en Arboledas, “la Fábrica del agua” en la región centro del departamento. El municipio está a 3 horas de “la perla del norte”.', '5.0');
insert into api_place (muni_id, idowner_id, lugar, description, calificacion) values (29, 34, 'Parque la cueva de los Guacharos', 'En límites con el departamento de Caquetá, a lo largo del río Suaza, hay un sistema de cavernas al amparo de la selva virgen.', '5.0');
insert into api_place (muni_id, idowner_id, lugar, description, calificacion) values (30, 35, 'Nevado del Huila', 'Además de sus fastuosos paisajes, el Nevado del Huila posee una inmensa riqueza hídrica compuesta por un sistema de lagunas, arroyos, quebradas y ríos que le tributan sus aguas a la Cuenca del río Magdalena y la Cuenca del río Cauca.', '5.0');
insert into api_place (muni_id, idowner_id, lugar, description, calificacion) values (31, 36, 'Embalse de Betania', 'La Represa o Embalse de Betania está ubicada a 38 Km. de Neiva, en la vía que conduce al municipio de Hobo. Su temmperatura aproximada 27 oC.', '5.0');
insert into api_place (muni_id, idowner_id, lugar, description, calificacion) values (32, 37, 'Cascadas Paicol', 'Paicol, Huila, es un pueblo escondido entre las montañas del sur de Colombia y el río Páez, un lugar que posee un estilo muy especial en sus calles y muchos atractivos naturales con un sello de aventura y paisajismo.', '5.0');
insert into api_place (muni_id, idowner_id, lugar, description, calificacion) values (33, 38, 'Parque Arqueológico de San Agustín', 'Es el mayor testimonio arqueológico del país. es su complejo se encuentran esculturas líticas de la cultura agustiniana, cuenta con caminos terraplenes, sarcófagos monolíticos, dolmenes, la fuente ceremonial del lavapatas, el alto del lavapatas, el museo Luis Duque Gomez, el bosque de las estatuas y las mesitas A, B, C y D.', '5.0');
insert into api_place (muni_id, idowner_id, lugar, description, calificacion) values (34, 39, 'Catedral de Sal', 'La Catedral de Sal es una de las obras de ingeniería más importantes de Colombia; y al mismo tiempo, uno de los principales atractivos turísticos del departamento de Cundinamarca.', '5.0');
insert into api_place (muni_id, idowner_id, lugar, description, calificacion) values (35, 40, 'Laguna de Guatavita', 'Probablemente sea el plan más popular de este pueblo, se trata de una laguna con una gran importancia histórica y una belleza incomparable. Cuando visites la Laguna te recomendamos hacer una visita guiada para que puedas aprender mucho más sobre sus ecosistemas y la importancia del lugar para la Cultura Muisca.', '5.0');
insert into api_place (muni_id, idowner_id, lugar, description, calificacion) values (36, 41, 'Cañón de la Lechuza', 'En la vereda Santa Rosa, de Suesca, el río Bogotá llega de Villapinzón y conforma un pequeño y tranquilo lago rodeado por altas paredes de roca que se conoce como el Cañón de la Lechuza y está ubicado a 45 minutos a pie de la vía que entra al casco urbano del municipio.', '5.0');
insert into api_place (muni_id, idowner_id, lugar, description, calificacion) values (37, 42, 'Quebrada Cune', 'Si quieres un lugar para admirar la belleza de la naturaleza, te recomendamos la Quebrada Cune. Este lugar que baña la población de Villeta, tiene 7 cascadas naturales llamadas Las Cascadas del Mico, siendo el principal atractivo turístico del municipio de Villeta.', '5.0');
insert into api_place (muni_id, idowner_id, lugar, description, calificacion) values (38, 43, 'Parque Arqueológico Piedras del Tunjo', 'El Parque Arqueológico de Facatativá (Piedras del Tunjo) está localizado en el municipio de Facatativá, en el departamento de Cundinamarca. Comprende aproximadamente 27 hectáreas donde se pueden encontrar abrigos rocosos, pintura rupestre y paisajes con gran riqueza ambiental.', '5.0');
insert into api_place (muni_id, idowner_id, lugar, description, calificacion) values (39, 44, 'Parque Natural de los Nevados', 'Si estás en el Departamento de Caldas y amas la naturaleza, ¡aprovecha y visita uno de los nevados de Colombia: el Parque Nacional Los Nevados. Este se extiende por los departamentos de Caldas, Risaralda, Quindío y Tolima.', '5.0');
insert into api_place (muni_id, idowner_id, lugar, description, calificacion) values (40, 45, 'San Félix: La Holanda Caldense', 'Al norte del Departamento de Caldas se encuentra el corregimiento San Félix, uno de los lugares más bellos de la zona. Desde hace varios años se conoce esta locación como ‘La Holanda Caldense’, gracias a sus espectaculares haciendas ganaderas y sus paisajes llenos de Palmas de Cera.', '5.0');
insert into api_place (muni_id, idowner_id, lugar, description, calificacion) values (41, 46, 'Parque Nacional Natural Selva de Florencia', 'es la única área de conservación nacional ubicada en el Oriente del Departamento de Caldas, con un 78% en territorio de Samaná y un 22% de Pensilvania. El parque es una de las zonas más lluviosas del país y alberga la mayor concentración de ranas del país.', '5.0');
insert into api_place (muni_id, idowner_id, lugar, description, calificacion) values (42, 47, 'Aguadas', 'Aguadas, el octavo municipio en extensión del departamento, es un lugar ideal para el descanso de los viajeros. Cuenta con un clima templado gracias a la variedad de pisos térmicos que van del cálido al páramo.', '5.0');
insert into api_place (muni_id, idowner_id, lugar, description, calificacion) values (43, 48, 'Aldea de María', 'Villamaría, fundado en 1852 con el nombre de Aldea de María, se encuentra ubicado en el extremo sur occidental del departamento, en límites con los departamentos de Risaralda y Tolima.', '5.0');
insert into api_place (muni_id, idowner_id, lugar, description, calificacion) values (44, 49, 'Sierra Nevada del Cocuy', 'Este Parque Nacional Natural de 306 mil hectáreas de extensión se encuentra en el centro oriente de la cordillera oriental, entre los departamentos de Boyacá , Arauca  y Casanare .Con una temperatura que oscila entre los 20º Centígrados y -4º Centígrados, el Parque es un sitio único para encontrarse con un tipo de naturaleza diferente ya que se conecta con la cordillera por el occidente y con el llano por el oriente.', '5.0');
insert into api_place (muni_id, idowner_id, lugar, description, calificacion) values (45, 50, 'Patio de Brujas', 'El lugar es un observatorio astronómico construido con tótems de arcilla de forma fálica, formando un anillo en torno un tótem central, los once tótems mayores marcan la salida del sol durante los solsticios y equinoccios, los tótems menores se utilizan para la medición de los movimientos de la luna, los tótems están decorados con iconografía prehispánica de culturas como la Tolima, Sinú, Muisca, Maya, Inca, y Nazca entre otras.', '5.0');
insert into api_place (muni_id, idowner_id, lugar, description, calificacion) values (46, 51, 'Santuario de Fauna y Flora Iguaque', 'Creado en 1.977, es una de las 46 áreas Naturales del país, ubicada a 2.400 a 3.800 mts sobre el nivel del mar, clima frío, 12 grados de temperatura, con una extensión de 6.750 hectáreas.', '5.0');
insert into api_place (muni_id, idowner_id, lugar, description, calificacion) values (47, 52, 'Laguna Careperro', 'Este hermoso lugar se encuentra ubicado en la cima del Monte Careperro, una vez allí y después de haber cruzado un sendero de casi tres horas de camino usted se encontrará a 3.600 metros sobre el nivel del mar.', '5.0');
insert into api_place (muni_id, idowner_id, lugar, description, calificacion) values (48, 53, 'Laguna de Tota', 'El Lago o Laguna de Tota, es el más grande de Colombia y el tercero en Suramérica, siendo uno de los recursos hidrológicos más importantes del país, no sólo por los usos que se le dan a sus aguas, sino por la riqueza paisajística que de manera permanente ofrece', '5.0');
